import sys
import base64
import restapi.emotion.src.detector.speech_to_text_emotion as stte
from restapi.emotion.src.detector.speech import SpeechEmotionDetection
from restapi.emotion.src.detector.util import convert_base64_to_file,convert_normalize
from restapi.emotion.src.detector.face import extract_emotion, map_to_standard_emotion
from restapi.emotion.voting import get_emotion
from pathlib import Path


REQUIRED_PYTHON = "python3"

PATH = str(Path(__file__).parent.resolve())

def main():
    system_major = sys.version_info.major
    if REQUIRED_PYTHON == "python":
        required_major = 2
    elif REQUIRED_PYTHON == "python3":
        required_major = 3
    else:
        raise ValueError("Unrecognized python interpreter: {}".format(
            REQUIRED_PYTHON))

    if system_major != required_major:
        raise TypeError(
            "This project requires Python {}. Found: Python {}".format(
                required_major, sys.version))
    else:
        print(">>> Development environment passes all tests!")

def test_speech():
    data_loc = PATH + "/data/raw/test.wav"
    classifier_loc = PATH + "/model/classifier.pickle"
    sed = SpeechEmotionDetection(classifier_loc, predict_proba=True)
    prediction = sed.predict(data_loc)
    #normalized = sed.map_to_standard_emotion(prediction)
    #print(normalized)
    assert prediction == {'angry': 0.92, 'fear': 0.02, 'happy': 0.06, 'sad': 0.0}

def test_speech_with_raw_files():
    data_loc = PATH+ "/data/raw/happy.aac"
    output = PATH + "/data/processed/converted.wav"
    convert_normalize(data_loc,output)
    classifier_loc = PATH + "/model/classifier.pickle"
    sed = SpeechEmotionDetection(classifier_loc, predict_proba=True)
    prediction = sed.predict(output)
    normalized = sed.map_to_standard_emotion(prediction)
    print(normalized)
    #assert normalized == {'anger': 0.5, 'fear': 0.2, 'happiness': 0.28, 'sadness': 0.02}

def test_base64():
    base_string = b''
    output = "data/processed/images.jpeg"
    convert_base64_to_file(base_string, output)

def test_image():
    image_path = "data/processed/images.jpeg"
    assert extract_emotion(image_path) == {'anger': 0.0, 'contempt': 0.003, 'disgust': 0.0, 'fear': 0.0, 'happiness': 0.317, 'neutral': 0.68, 'sadness': 0.0, 'surprise': 0.0}

def test_combined():
    image_64 = b''

    sound_64 = b''

    
    emotion = get_emotion(image_64, sound_64)
    print(emotion)
    return emotion

def test_image():
    temp_image_file = PATH + "/data/raw/image_file.jpeg"
    prediction = extract_emotion(temp_image_file)
    prediction = map_to_standard_emotion(prediction)
    print(prediction)

def test_speech_to_text():
    data_loc = PATH+ "/data/raw/happy.aac"
    output = PATH + "/data/processed/converted.wav"
    convert_normalize(data_loc,output)
    #sound_stream = #open(output,"rb")
    text = stte.get_text_from_speech(output)
    prediction = stte.analyze_text(text)
    print(prediction)

def test_combined_file():
    sound_file = PATH+ "/data/raw/sound_file.m4a"
    image_file = PATH+ "/data/processed/images.jpeg"
    im_64 = None
    sound_64 = None
    with open(image_file, "rb") as imfile:
        im_64 = base64.b64encode(imfile.read())
    with open(sound_file, "rb") as soundfile:
        sound_64 = base64.b64encode(soundfile.read())
    emotion = get_emotion(im_64, sound_64)
    print(emotion)

if __name__ == '__main__':
    #test_speech_with_raw_files()
    #test_image()
    #test_base64()
    #test_combined()
    test_combined_file()
    main()
